  03> CAMERON, Andrew Lee
  b 25.06.1970
  Andrew b. at Drogheda, Eire.
  Andrew was educated at Waihi School, Christ's College and Telford Agricultural College. He
  represented Christ's at athletics for two years. He is now a builder in Wellington.
  03> DILLON, Patrick Francis Lee m on 22.03.1974 to THODEY, Susan Lee
  b 11.01.1946
  b 23.04.1945
  Patrick m, at Timaru, Susan, d/o Dr and Mrs ES Thodey of Timaru. Address: "Wairikiriki", The Lake
  Road, Irwell, Canterbury.
  Patrick was educated at Waihi School, South Canterbury and Christ's College. He farmed "Leefield",
  Blenheim until the property was sold in 1988.
  01> DILLON, Lisa Francis
  b 14.03.1975
  Lisa b. at Timaru and educated at Selwyn House and Rangi Ruru, Christchurch.
  02> DILLON, Jonathan Patrick Lee
  b 07.06.1977
  Jonathan b. at Blenheim and educated at Waihi School, South Canterbury and Christ's College,
  Christchurch,
  03> DILLON, Mark Peter Lee
  b 18.02.1981
  Mark b. at Blenheim and educated at Medbury School and Christ's College, Christchurch,
  04> DILLON, Brigid Louise Lee
  b 21.06.1982
  Bridgid b. at Blenheim and educated at Selwyn House and Rangi Ruru, Christchurch.
  06> WILLIAMS, Wyvern Henrym on 21.07.1909 to MASON, Evelyn Muriel
  b 15.05.1870 d 09.04.1910
  b 02.03.1886 d 25.06.1965
  Wyvern b. at Hutt and d. at Kaipara. Evelyn later married Frank Fryer and had two daughters. Frank was an All
  Black (1907-08) and a dentist in Hastings.
  Wyvern was educated at Christ's College and farmed for a time at Kaipara.
  Refer to "The Family and Thomas and Jane Mason of Taita" published by Evagean Publishing in 1994 for records of
  Evelyn's family.
  01> WILLIAMS, Wyvern Annie m on 18.04.1934 to BUNNY, William Ian
  b 26.05.1910 d 28.07.1986
  b 08.04.1909 d 07.10.1971
  Wyvern b, at Auckland and d. at Masterton. William farmed "Te Roto", Bideford, Masterton,
  01> BUNNY, Beveley Ann m on 11.12.1969 to ARMISTEAD, Cyril James
  b 31.03.1936
  b 09.05.1937
  Beveley b. and m. at Masterton. James, s/o Cyril Armistead and Constance Alloway, b. at Palmerston
  North. Address: "Awapai", Bluff Road, Woodville.
  Beveley was educated at St Matthew's Collegiate School in Masterton. She travelled overseas in 1957
  and later worked with families in the South Island. She competed in the showring for many years and
  also hunted and evented until she married and moved to Woodville. She assisted with the local Girl
  Guides and served on the committee of the St Matthew's Old Girls' Association and later on the Board of
  Trustees for three years. She now spends time golfing and gardening or helping to sell Hunter clothing
  at shows, gala days etc.
